import React from "react";

export default function Card(props) {
  // console.log('hey probando')
  // ac치 va tu c칩digo

  console.log(props);
  return (
    // console.log(props)
    // <> es igual a <react.Fragment></react.Fragment>
    <>
      <h1>{props.name}</h1>
      <h3>Min</h3>
      <h4>{props.min}</h4>
      <h3>Max</h3>
      <h4>{props.max}</h4>

      <img src={`http://openweathermap.org/img/wn/${props.img}@2x.png`} alt=""/>
      <button>X</button>
    </>
  );
}
